function safe_char_upcase(x) {
    var xu = x.toUpperCase();
    if (codepoints(xu).length == 1) {
        return xu;
    } else {
        return x;
    }
}
function safe_char_downcase(x) {
    var xl = x.toLowerCase();
    if (codepoints(xl).length == 1) {
        return xl;
    } else {
        return x;
    }
}

